import React, { useEffect } from 'react'
import './Navbar.css'
import { NavLink } from 'react-router-dom';


const Navbar = () => {

    useEffect(() => {
        /**
         * Easy selector helper function
         */
        const select = (el, all = false) => {
          el = el.trim();
          if (all) {
            return [...document.querySelectorAll(el)];
          } else {
            return document.querySelector(el);
          }
        };
    
        /**
         * Easy event listener function
         */
        const on = (type, el, listener, all = false) => {
          let selectEl = select(el, all);
          if (selectEl) {
            if (all) {
              selectEl.forEach((e) => e.addEventListener(type, listener));
            } else {
              selectEl.addEventListener(type, listener);
            }
          }
        };
    
        /**
         * Easy on scroll event listener
         */
        const onscroll = (el, listener) => {
          el.addEventListener('scroll', listener);
        };
    
        /**
         * Navbar links active state on scroll
         */
        let navbarlinks = select('#navbar .scrollto', true);
        const navbarlinksActive = () => {
          let position = window.scrollY + 200;
          navbarlinks.forEach((navbarlink) => {
            if (!navbarlink.hash) return;
            let section = select(navbarlink.hash);
            if (!section) return;
            if (
              position >= section.offsetTop &&
              position <= section.offsetTop + section.offsetHeight
            ) {
              navbarlink.classList.add('active');
            } else {
              navbarlink.classList.remove('active');
            }
          });
        };
        window.addEventListener('load', navbarlinksActive);
        onscroll(document, navbarlinksActive);
    
        /**
         * Scrolls to an element with header offset
         */
        const scrollto = (el) => {
          let header = select('#header');
          let offset = header.offsetHeight;
    
          let elementPos = select(el).offsetTop;
          window.scrollTo({
            top: elementPos - offset,
            behavior: 'smooth',
          });
        };
    
        /**
         * Mobile nav toggle
         */
        on('click', '.mobile-nav-toggle', function (e) {
          select('#navbar').classList.toggle('navbar-mobile');
          this.classList.toggle('bi-list');
          this.classList.toggle('bi-x');
        });
    
        /**
         * Mobile nav dropdowns activate
         */
        on('click', '.navbar .dropdown > a', function (e) {
          if (select('#navbar').classList.contains('navbar-mobile')) {
            e.preventDefault();
            this.nextElementSibling.classList.toggle('dropdown-active');
          }
        }, true);
    
        /**
         * Scroll with offset on links with a class name .scrollto
         */
        on('click', '.scrollto', function (e) {
          if (select(this.hash)) {
            e.preventDefault();
    
            let navbar = select('#navbar');
            if (navbar.classList.contains('navbar-mobile')) {
              navbar.classList.remove('navbar-mobile');
              let navbarToggle = select('.mobile-nav-toggle');
              navbarToggle.classList.toggle('bi-list');
              navbarToggle.classList.toggle('bi-x');
            }
            scrollto(this.hash);
          }
        }, true);
    
        /**
         * Scroll with offset on page load with hash links in the URL
         */
        window.addEventListener('load', () => {
          if (window.location.hash) {
            if (select(window.location.hash)) {
              scrollto(window.location.hash);
            }
          }
        });
    
        // Cleanup event listeners on component unmount
        return () => {
          window.removeEventListener('load', navbarlinksActive);
          window.removeEventListener('scroll', navbarlinksActive);
        };
      }, []);
    return (
        <>
            <header id="header" className="fixed-top">
                <div className="container d-flex align-items-center justify-content-between">

                    <h1 className="logo"><NavLink to="index.html">Medicare</NavLink></h1>

                    <nav id="navbar" className="navbar">
                        <ul>
                            <li><NavLink className="nav-link scrollto" to="#hero">Home</NavLink></li>
                            <li><NavLink className="nav-link scrollto" to="#about">About</NavLink></li>
                            <li><NavLink className="nav-link scrollto" to="#services">Services</NavLink></li>
                            <li><NavLink className="nav-link scrollto " to="#portfolio">Portfolio</NavLink></li>
                            <li><NavLink className="nav-link scrollto" to="#team">Team</NavLink></li>
                            <li><NavLink className="nav-link scrollto" to="#pricing">Pricing</NavLink></li>
                            <li className="dropdown"><NavLink to="#"><span>Drop Down</span> <i className="bi bi-chevron-down"></i></NavLink>
                                <ul>
                                    <li><NavLink to="#">Drop Down 1</NavLink></li>
                                    <li className="dropdown"><NavLink to="#"><span>Deep Drop Down</span> <i className="bi bi-chevron-right"></i></NavLink>
                                        <ul>
                                            <li><NavLink to="#">Deep Drop Down 1</NavLink></li>
                                            <li><NavLink to="#">Deep Drop Down 2</NavLink></li>
                                            <li><NavLink to="#">Deep Drop Down 3</NavLink></li>
                                            <li><NavLink to="#">Deep Drop Down 4</NavLink></li>
                                            <li><NavLink to="#">Deep Drop Down 5</NavLink></li>
                                        </ul>
                                    </li>
                                    <li><NavLink to="#">Drop Down 2</NavLink></li>
                                    <li><NavLink to="#">Drop Down 3</NavLink></li>
                                    <li><NavLink to="#">Drop Down 4</NavLink></li>
                                </ul>
                            </li>
                            <li><NavLink className="nav-link scrollto" to="#contact">Contact</NavLink></li>
                            <li><NavLink className="getstarted scrollto" to="#about">Get Started</NavLink></li>
                        </ul>
                        <i className="bi bi-list mobile-nav-toggle"></i>
                    </nav>

                </div>
            </header>

        </>
    )
}

export default Navbar
